    hv_XsUsed.Dispose();
    HOperatorSet.TupleConcat(hv_XsUsed1, hv_XsUsed2, out hv_XsUsed);
    hv_YsUsed.Dispose();
    HOperatorSet.TupleConcat(hv_YsUsed1, hv_YsUsed2, out hv_YsUsed);
