        hv_VAxisX1, hv_VAxisY1, hv_VAxisX1, hv_VAxisY1, out hv_VAxisX2, out hv_VAxisY2);

    //offset the horizontal line
    using (HDevDisposeHelper dh = new HDevDisposeHelper())
